import React from "react";

const MagnificientEqualButton = ({ calc, setCalc }) => {
	const calculate = () => {
		try {
			setCalc(eval(calc));
		} catch {
			setCalc("Error");
		}
	};

	return (
		<div className="MagnificientEqualButton">
			<button onClick={calculate} value="=">
				=
			</button>
		</div>
	);
};

export default MagnificientEqualButton;
